var wow = new WOW({
    boxClass: "wow",
    animateClass: "animated",
    offset: 0,
    mobile: !0,
    live: !0,
    callback: function (e) { },
    scrollContainer: null,
    resetAnimation: !0
});
wow.init();
for (var element = document.getElementsByClassName("b-toggle"), i = 0; i < element.length; i++)
    element[i].onclick = function () {
        for (var e = element[0]; e;)
            "LI" === e.tagName && e.classList.remove("active"),
                e = e.nextSibling;
        this
            .classList
            .add("active")
    };
for (element = document.getElementsByClassName("b-hash-menu"), i = 0; i < element.length; i++)
    element[i].onclick = function () {
        for (var e = element[0]; e;)
            "LI" === e.tagName && e.classList.remove("active"),
                e = e.nextSibling;
        this
            .classList
            .add("active")
    };